    false,nt"url": null,nt"notes": "This map layer includes Global Map data
    showing cities and towns in the United States, Puerto Rico, and the U.S. Virgin
    Islands. The data are a modified version of the National Atlas of the United States
    1:1,000,000-scale cities and towns of the United States; those source data were
    derived from the Geographic Names Information System (GNIS) and the U.S. Census
    Bureau National Places Gazetteer files. Global Map refers to these locations as
    Built-up Area (point) and defines them as areas containing a concentration of buildings
    and other structures (smaller than Built-up Area (face)). National Atlas cities
    or towns are defined as places with a recorded population, usually with at least
    one central area that provides commercial activities. Cities are generally larger
    than towns; no distinction is made between cities and towns in this map layer. No
    attempt has been made to reconcile the Global Map and National Atlas feature definitions.",nt"license_title":
